import React from 'react';
import {  Link } from "react-router-dom";


const Navbar = () => {

  return (
  <div className='nav'>
      <ul className='navbar'>
    <li>
      <Link className='home' to="/"> Home </Link>
      <Link className='list' to="/list"> List </Link>
      <Link className='login' to="/login"> Log in </Link>
    </li>
    </ul>
  </div>
  );
}
export default Navbar;
